css:
@-moz-document domain("fi.nobelium.xyz") {
body {
    background: url("http://wayback.archive.org/web/20110502183421im_/http://www.roblox.com/images/cssspecific/rbx2/bkg.jpg") top center repeat-x #000444 !important;
}

nav {
    position: absolute;
    left: 25%;
    width: 900px;
    height: 225px;
    background: url("http://wayback.archive.org/web/20110502192133im_/http://www.roblox.com/images/cssspecific/rbx2/head_03.jpg") repeat scroll 0 0 transparent;;
}

.navbar-light.bg-faded {
    border: 0;
}

.navbar-toggleable-md>.container {
    width: 900px;
    height: 30px;
    background: url("http://wayback.archive.org/web/20110502192134im_/http://www.roblox.com/images/cssspecific/rbx2/topNav_blue.png");
	background-position: 0 0;
    text-align: center;
    line-height: 20px;
    position: absolute;
    left: 0%;
    bottom: 0%;
    margin: 0;
    padding: 0;
}

.navbar-brandimg {
    visibility: hidden;
}

.navbar-light .navbar-brand, .navbar-light .navbar-brand:focus, .navbar-light .navbar-brand:hover, .navbar-light .navbar-toggler, .navbar-light .navbar-toggler:focus, .navbar-light .navbar-toggler:hover {
    color: #fff;
    font-family: Arial,Helvetica,sans-serif;
    margin-top: 7px;
}

.navbar-light .navbar-nav .nav-link {
    color: #fff;
    font-family: Arial,Helvetica,sans-serif;
}

.navbar-light .navbar-nav .nav-link:hover {
    color: #fff;
    font-family: Arial,Helvetica,sans-serif;
}

.container {
    position: absolute;
    left: 25%;
    margin: 0;
    padding: 5px;
    width: 890px;
    background: url("http://wayback.archive.org/web/20110502192134im_/http://www.roblox.com/images/cssspecific/rbx2/containerBkg_01.png");
}

.card-header {
    color: #fff;
    display: block;
    width: 100%;
    height: 29px;
    padding: 5px 5px 0 2px;
    background: url(http://wayback.archive.org/web/20110703012640im_/http://www.roblox.com/images/cssspecific/rbx2/tab_black_33h_t2.png) no-repeat right top;
    overflow: hidden;
    border: 0;
}

.n-btn-games-small {
    border: solid 1px #777;
    margin: 15px;
    margin-left: -10px;
    padding: 3px 10px;
    width: 100px;
    border-radius: 0;
}

.btn-primary.active, .btn-primary:active, .show>.btn-primary.dropdown-toggle {
    background-color: #6e99c9;
    border: solid 1px #000;
    margin: 15px;
    padding: 3px 10px;
    width: 100px;
    border-radius: 0;
}

.breadcrumb {
    visibility: hidden;
}

.btn-success {
    width: 212px;
    height: 54px;
    background: url("http://wayback.archive.org/web/20110705152109im_/http://www.roblox.com/images/cssspecific/rbx2/btn_play_54h.png");
    cursor: pointer;
    padding: 0;
    border: 0;
    text-decoration: none;
    margin: 0;
    margin-top: 30px;
    display: inline-block;
}

.footer {
    visibility: hidden;
}
}
